import Home from "./pages/home/Home";
import { render } from "react-dom";
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";

function App() {
  return (
    <div className="App">
     <BrowserRouter>
      <Routes>
        <Route path="/"></Route>
      </Routes>
    </BrowserRouter>,
    </div>
  );
}

export default App;
